    true,nt"url": null,nt"notes": "<p>Medicare payment to ESRD facilities for
    outpatient maintenance dialysis services furnished to Medicare beneficiaries with
    End-Stage Renal Disease (ESRD) is based on a prospective payment system known as
    the basic case-mix adjusted composite payment system.  The base composite rate covers
    the costs of the dialysis treatment and certain routine drugs, laboratory tests,
    and supplies furnished at home or in a facility.</p>n",nt"license_title": "Other
